namespace Shine
{
	/** 属性方式类型(generated by shine) */
	export class AttributeMethodType
	{
		/** 独立属性 */
		public static Single:number=1;
		
		/** 当前属性 */
		public static Current:number=2;
		
		/** 一级属性 */
		public static FirstGroup:number=3;
		
		/** 二级属性 */
		public static SecondGroup:number=4;
		
		/** 属性因子(5项值) */
		public static GroupElement:number=5;
		
		/** 长度 */
		public static size:number=6;
		
	}
}
